import React from 'react';
import { useState } from 'react';
export default function Dashboard() {

  const [file, setFile] = useState(null);

  const getSharksData = async () => {
    const response = await fetch('https://localhost:8081/sharks');
    const data = await response.json();
    console.log(JSON.stringify(data));
    setFile(JSON.stringify(data));
  }

  const getUserProperties = async ({ id }) => {
    const response = await fetch('https://localhost:8081/getProperties', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ id }),
    });
    console.log(response);
    const data = await response.json();
    console.log(JSON.stringify(data));
    setFile(data);
  }

  const updateUserProperties = async ({ id, address, type, price, status }) => {
    const response = await fetch('https://localhost:8081/updateProperties', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ id, address, type, price, status }),
    });
    console.log(response);
    const data = await response.json();
    console.log(JSON.stringify(data));
    setFile(data);
  }

  return (
    <div className="Dashboard">
      <h2>Dashboard</h2>
      <button onClick={getSharksData}>Get Sharks Data</button>
      <button onClick={
        () => getUserProperties({ id: '1' })
      }>Get User Properties</button>
      <div>
        {file && (
          <>
            <div>
              {file.map((item) => (
                <div key={item.id}>
                  <p>{item.property_id}</p>
                  <p>{item.user_id}</p>
                  <p>{item.address}</p>
                  <p>{item.type}</p>
                  <p>{item.price}</p>
                  <p>{item.status}</p>

                </div>
              ))}
            </div>
            <button onClick={
              () => getUserProperties({ id: '1' })
            }>Get User Properties</button>
          </>
        )}
      </div>
    </div>
  );
}
